const getDangerLevelClass = (dangerLevel) => {
  switch (dangerLevel) {
    case 1:
      return 'danger-level-1';
    case 2:
      return 'danger-level-2';
    case 3:
      return 'danger-level-3';
    default:
      return 'danger-level-0';
  }
};

